import React from 'react';

import { MediaQuery } from 'react-responsive'
import DesktopBreakpoint from '../utilities/desktopbreakpoint';
import TabletBreakpoint from '../utilities/tabletbreakpoint';
import PhoneBreakpoint from '../utilities/phonebreakpoint';
import ClientCard from '../components/ClientCard.js';
import {UserAddOutlined} from '@ant-design/icons';
import MatchedClientCard from '../components/MatchedClientCard';



function ClientPage4(){
    return(
        <div>
        <PhoneBreakpoint>

        <SearchBar/>

        <h3>Our Recommended Clients</h3>

        <div style={{textAlign:'right' ,marginRight:'10px'}}>
        <UserAddOutlined  />
        </div>

        <MatchedClientCard name="Client Name 1" status="client status 1" id="id1"></MatchedClientCard>
        <MatchedClientCard name="Client Name 2" status="client status 2" id="id5"></MatchedClientCard>

        </PhoneBreakpoint>
        </div>


    )
}

export default ClientPage2
